import React from 'react';
import './App.css';
import {Container} from "@chakra-ui/react";
import Navbar from "./components/Navbar";
import MainPage from "./components/MainPage";

function App() {
  return (
    <Container bg='#030303' minHeight='100vh' minWidth='100%'>
      <header>
        <Navbar/>
      </header>

      <body>
        <MainPage/>
      </body>
    </Container>
  );
}
export default App;
